import React from 'react';
import End from "../end.webp";

function Endofresult() {
    return (
        <div className="end-main">
            <div className="end-p">
            <p>End of result</p>
            </div>
            <div>
            <img src={End} alt="end" className="endofresult"></img>
            </div>
        </div>
    )
}

export default Endofresult
